import React from 'react';
import './App.css';
import Objective from "./components/Card/Objective.js"
import Sidebar from "./components/Sidebar/Sidebar.js"

const data = JSON.parse('{"objective":[{"title":"Objective 1", "id":"1", "task":[{"id": "3","title": "task1","specific": "sasdad","measurable": "ad","achievable": "ads","relevant": "asd","status": "asd"}, {"id": "4","title": "task2","specific": "sasdad","measurable": "ad","achievable": "ads","relevant": "asd","status": "asd"}]},{"title":"Objective 2","id":"2","task":[{"id": "5","title": "task12","specific": "sasdad","measurable": "ad","achievable": "ads","relevant": "asd","status": "asd"}, {"id": "6","title": "task22","specific": "sasdad","measurable": "ad","achievable": "ads","relevant": "asd","status": "asd"}]}]}');

function handleClick(e) {
    e.preventDefault();
    console.log('The link was clicked.');
    return (
        <div className="content">{data.objective.map(objective =>
            <Objective key={objective.id} objective={objective}/>)}
        </div>
    );
}

function App() {
    return (<div className="App">{/*<Sidebar />*/}

        <button onClick={handleClick}>
            Activate Lasers
        </button>
    </div>);
}

export default App;
